import React from 'react';

export default () => (
    <React.Fragment>
        <h1>Hola Mundo</h1>
        <img src="/public/img/platzi-logo.png" alt="Platzi Logo" />
        <style jsx>{`
            h1 {
                color: black;
            }
        `}</style>
        <style jsx global>{`
            body {
                background: #d3d3d3;
            }
        `}</style>
    </React.Fragment>
)
